import React from 'react';

const SignUp = () => {
return (
	<div>
	<h1>Sign Up</h1>
	<table>
		<tr>
		<td><label for="uname">User name</label></td>
		<td><input type="text" id="uname" name="unameval"/></td>
		</tr>
		<tr>
		<td><label for="pwd">Password</label></td>
		<td><input type="text" id="pwd" name="pwdval"/></td>
		</tr>
	</table>
	</div>
);
};

export default SignUp;
